// src/components/LoginSignup.js
import React from 'react';

const LoginSignup = () => {
  return (
    <div style={{ position: 'fixed', top: '20px', right: '20px', background: '#fff', padding: '10px', border: '1px solid #ccc', borderRadius: '5px' }}>
      <h3>Login / Signup</h3>
      <button>Login</button>
      <button>Signup</button>
    </div>
  );
};

export default LoginSignup;
